import React from 'react'
import { Link, NavLink, Match, NoMatch } from 'react-router-dom'

const Header = () => {

    return(
        <ul className='UL-List'>
            <NavLink to={`/find`} className="HeadItem" id="HeadItem-R">
            <li  activeClassName="activehead">Find</li>
            </NavLink>
            <NavLink to={`/`} activeClassName='activehead'>
            <li className="HeadItem" id="HeadItem-L">Home</li>
            </NavLink>
            
        </ul>
        
    )
}

export default Header;
